using Microsoft.AspNetCore.Mvc;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using UploadFiles.On.External.Domain.Code.Base;

namespace test.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class testController : ControllerBase
    {
        private readonly IUpLoadFile IUpLoadFile;

        public testController(IUpLoadFile iUpLoadFile)
        {
            IUpLoadFile = iUpLoadFile;
        }
        [HttpPost]
        public ActionResult Post()
        {
            try
            {
                int type = 3;
                var doc = "";
                var pdf = "";
                var img = "";
                (string, FeedBack) Result = IUpLoadFile.UpLoad2(type == (int)FilesType.Image ? img : type == (int)FilesType.PDF ? pdf : doc, "Test", (FilesType)type);
                return Ok(new { img = Result.Item1, feedBack = Result.Item2 });
            }
            catch (Exception e)
            {
                return BadRequest(e.Message);
            }
        }
    }
}
